O software deverá ter garantia de atualização pelo período de 12 (doze) meses. 

O suporte técnico deverá estar disponível, no mínimo, 24 (vinte e quatro) horas por dia, 07 (sete) dias por semana, em português ou por meio de um tradutor;

Disponibilidade para abertura de chamado: 24x7x365 (web, e-mail ou telefone).

O atendimento será preferencialmente remoto. Caso haja necessidade de intervenção local, esta deverá ser executada. Nos dois casos, sempre com acompanhamento pela equipe técnica da contratante.

A contratada deverá garantir suporte técnico para disponibilização da instalação e operacionalização das licenças, caso a equipe técnica da contratante tenha dificuldades em realizar a implantação do pacote das licenças;

